import React from "react";
import axios from "axios";
import {
  Container,
  Row,
  Col,
  Card,
  Modal,
  Form,
  Button,
  InputGroup,
  Navbar,
  Nav,
  NavDropdown,
  FormControl,
  ListGroup
} from "react-bootstrap";
import ConvoDetails from "./ConvoDetails";
import moment from '.'
function Messages(props) {
  return (
  props.messages.map((mess) => (
    <Card style={{ width: '18rem' }} key={mess.id}>
    {/* <div key={mess.id}> */}
    <ListGroup variant="flush">
    <ListGroup.Item>
      <a
        href="#"
        onClick={() => {
          props.getMessageDetail(mess.id, mess.message);
        }}
      >
        <h5>{mess.message}</h5>
      </a>
      <br></br>
      {moment(mess.submission_time).add(365, 'day').format('LL')}
      <br></br>
      {mess.id}
      </ListGroup.Item>
      </ListGroup>
    </Card>
  )))
}
export default Messages;
